import React from 'react';

const Header = () => {
    return <div className='head-container'> 
    <img src='https://user-images.githubusercontent.com/2F26179770/106359099-693e3380-6336-11eb-8069-9e36f25de5ca.png' alt='Header Image' className='image-container'/>
    <h1 className='head-text'>Name It</h1>
    </div>
};

export default Header;
